        public Form1()
        {
            InitializeComponent();
        }

        private void Form1_Load(object sender, EventArgs e)
        {
            try
            {
                if (Settings.Default.saveRecord)
                {
                    wins = Settings.Default.wins;
                    losses = Settings.Default.losses;
                    badGuesses = Settings.Default.badGuesses;
                }
                GameStart();
            }
            catch (Exception xcpt)
            {
                ExceptionCaught(xcpt);
            }
            finally { }
        }

        private void ExceptionCaught(Exception xcpt)
        {
            string message = xcpt.Message;
            string stacktrace = xcpt.StackTrace;
            MessageBox.Show(this,$"{ stacktrace }",$"{ message }",MessageBoxButtons.OK);
            Debug.WriteLine(
                $"{ DateTime.Now } - { message }{ Environment.NewLine }" +
                $"{ Environment.NewLine }" +
                $"{ stacktrace }"
                );
            Console.WriteLine(
                $"{ DateTime.Now } - { message }{ Environment.NewLine }" +
                $"{ Environment.NewLine }" +
                $"{ stacktrace }"
                );
        }

