        private void saveRecordToolStripMenuItem1_Click(object sender, EventArgs e)
        {
            saveRecordToolStripMenuItem1.Checked = !(saveRecordToolStripMenuItem1.Checked);
            Settings.Default.saveRecord = saveRecordToolStripMenuItem1.Checked;
            Settings.Default.Save();
        }

        private void viewRecordToolStripMenuItem_Click(object sender, EventArgs e)
        {
            if (wins + losses >= 1)
            {
                MessageBox.Show(this, $"{ wins } wins{ Environment.NewLine }{ losses } losses{ Environment.NewLine }{ Environment.NewLine }{ wins + losses } total games{ Environment.NewLine }{ Environment.NewLine }{ badGuesses } bad guesses", "Record", MessageBoxButtons.OK);
            }
            else
            {
                MessageBox.Show(this, $"{ wins } wins{ Environment.NewLine }{ losses } losses{ Environment.NewLine }No games played", "Record", MessageBoxButtons.OK);
            }
        }

        private void resetRecordToolStripMenuItem_Click(object sender, EventArgs e)
        {
            if (MessageBox.Show(this, $"Are you sure you want to reset your record?{ Environment.NewLine }{ Environment.NewLine }This cannot be undone.", "Reset?", MessageBoxButtons.YesNo) == DialogResult.Yes)
            {
                Settings.Default.wins = 0;
                Settings.Default.losses = 0;
                Settings.Default.badGuesses = 0;
                Settings.Default.Save();
                wins = 0;
                losses = 0;
            }
        }

        private void resetGameToolStripMenuItem_Click(object sender, EventArgs e)
        {
            GameStart();
        }

        private void textBoxGuess_TextChanged(object sender, EventArgs e)
        {
            try
            {
                //reduce if 2 characters
                if (textBoxGuess.TextLength > 1)
                {
                    textBoxGuess.Text = textBoxGuess.Text.Remove(1);
                }
                //check if still something in field
                if (textBoxGuess.TextLength >= 1)
                {
                    //if so, and not a letter, clear it
                    if (!Char.IsLetter(textBoxGuess.Text[0]))
                    {
                        textBoxGuess.Text = "";
                        MessageBox.Show(this, "Must guess a letter!", "Error", MessageBoxButtons.OK);
                    }//otherwise it's allowed
                }
                //auto submit
                if (textBoxGuess.TextLength == 1)
                {
                    //submit guess
                    string guess = textBoxGuess.Text.ToLower();
                    textBoxGuess.Text = "";
                    //letter not guessed yet
                    if (!(labelGuesses.Text.ToLower().Contains(guess)))
                    {
                        if (labelGuesses.Text != "")
                        {
                            labelGuesses.Text += ",";
                        }
                        //if word has guess
                        if (WordToGuess.ToLower().Contains(guess))
                        {
                            Console.WriteLine(guess + " found!");
                            char[] wordChar = WordToGuess.ToLower().ToCharArray();
                            char[] label = labelWordToGuess.Text.ToLower().ToCharArray();
                            for (int i = 0; i < wordChar.Length; i++)
                            {
                                if (Char.IsLetter(wordChar[i]))
                                {
                                    if (wordChar[i].ToString() == guess)
                                    {
                                        label[i] = Char.Parse(guess);
                                    }
                                }
                                else
                                {
                                    label[i] = wordChar[i];
                                }
                            }
                            labelWordToGuess.Text = "";
                            foreach (char c in label)
                            {
                                labelWordToGuess.Text += c;
                            }
                        }
                        else
                        {
                            guessesLeft -= 1;
                            badGuesses += 1; 
                            object obj = Resources.ResourceManager.GetObject($"_{ 11 - guessesLeft }");
                            pictureBox1.Image = (Image)obj;
                        }
                        labelGuesses.Text += guess;
                    }
                    textBoxGuess.Select();

                    //check win state
                    //win
                    bool wordGuessed = true;
                    string word = labelWordToGuess.ToString();
                    foreach (char c in word)
                    {
                        if (c == '_')
                        {
                            wordGuessed = false;
                        }
                    }
                    if (wordGuessed)
                    {
                        wins += 1;
                        Settings.Default.wins += 1;
                        Settings.Default.Save();
                        string text = $"You guessed the word!{ Environment.NewLine }" +
                            $"{ Environment.NewLine }" +
                            $"{ wins } wins{ Environment.NewLine }" +
                            $"{ losses } losses{ Environment.NewLine }" +
                            $"{ Environment.NewLine }" +
                            $"{ wins + losses } total games{ Environment.NewLine }" +
                            $"{ Environment.NewLine }" +
                            $"{ badGuesses } bad guesses";
                        MessageBox.Show(this, text, "Congratulations!", MessageBoxButtons.OK);
                        GameStart();
                    }

                    //loss
                    if (guessesLeft == 0)
                    {
                        losses += 1;
                        Settings.Default.losses += 1;
                        Settings.Default.Save();
                        string text = $"You ran out of guesses. The word was { WordToGuess }.{ Environment.NewLine }" +
                            $"{ Environment.NewLine }" +
                            $"{ wins } wins{ Environment.NewLine }" +
                            $"{ losses } losses{ Environment.NewLine }" +
                            $"{ Environment.NewLine }" +
                            $"{ wins + losses } total games{ Environment.NewLine }" +
                            $"{ Environment.NewLine }" +
                            $"{ badGuesses } bad guesses";
                        MessageBox.Show(this, text, "You lost!", MessageBoxButtons.OK);
                        GameStart();
                    }
                }
            }
            catch (Exception xcpt)
            {
                ExceptionCaught(xcpt);
            }
        }
    }
